import React from 'react';
import { Row, Col } from 'reactstrap';

import styles from './Person.module.css';

const person = (props) => {
    const record = props.parent.props.source[props.index];

    return (
            <Row className={[styles.Person, styles.NewListItem].join(" ")}>
                <Col xs="6" sm="4">
                    <p className={styles.Title}>Number:</p>
                    <p className={styles.Body}>{record.number}</p>
                </Col>
                <Col xs="6" sm="4">
                    <p className={styles.Title}>Name:</p>
                    <p className={styles.Body}>{record.name}</p>
                </Col>
                <Col xs="6" sm="4">
                    <p className={styles.Title}>Id:</p>
                    <p className={styles.Body}>{record.id}</p>
                </Col>
            </Row>
    );
}

export default person;
